import { IonCol, IonGrid, IonInput, IonItem, IonLabel, IonRow } from '@ionic/react';
import React from 'react';

const PromotionForm: React.FC<{name: string, isDisabled: boolean}> = (props) =>{
    return(
        <IonGrid>
            <IonRow>
                <IonCol>
                    <IonItem>
                        <IonLabel>Promotion Name</IonLabel>
                        <IonInput disabled={props.isDisabled}></IonInput>
                    </IonItem>
                </IonCol>
            </IonRow>
        </IonGrid>
    );
};

export default PromotionForm;
